Here is what I was trying to do (using the change I suggest): @Aspect @DeclarePrecedence({"AuthenticationAspect, AuthorizationAspect", "PoolingAspect, LoggingAspect"}) class SystemCoordinator { }
Generally, I try to follow the pattern (as recommended in AJIA), where the "regular" aspect themselves do no declare any precedence rules (that would cause code-tangling experienced in now-unsupported "dominates" construct). Instead, I write another "co-ordinating" aspect that specifies the precedence rules for aspects in my system.
Part of the issue is simply asymmetry between the code-style and @AspectJ syntax. In code-style, one aspect can include any number of precedence declaration. So the same thing should be possible with @AspectJ.

